                        <div className="right-info">
                            <h3>Make No Little Plans</h3>
                            <p>We’re named for New York’s iconic Flatiron Building, Daniel
                                Burnham’s architectural marvel erected in 1902… Burnham is famously
                                quoted as saying, “Make no little plans. They have no magic to stir
                                men’s blood and probably themselves will not be realized.”<br/>

                                We’ve got big plans — and we’re here to change things. At Flatiron
                                School, we knock down barriers, facilitate entry into tech, and teach
                                21st-century tech skills to people of all ages, backgrounds, and
                                experience levels around the world.</p>
                        </div>
